INSERT INTO Events (Name,Title,ShortDescription,ContentHtml,Place,RegisterTime,Time,CreatedDate,ModifiedDate,ImageURL) VALUES (N'Khởi nghiệp tinh gọn cho người bận rộn: Phỏng vấn giải pháp',N'Khởi Nghiệp',N'Có một giải pháp cho khách hàng từ những vấn đề của họ không đảm bảo được thành công. Khi có những giải pháp cũng đồng nghĩa bạn cần phải đi phỏng vấn bằng các cách khác nhau để thực sự hiểu giải pháp của mình có giá trị như mong muốn trong con mắt khách hàng. Vậy nên hỏi gì, hỏi như thế nào? Làm sao để biết khách hàng sẵn sàng trả bao nhiêu cho giải pháp của bạn? Hãy cùng chúng tôi tham gia buổi đào tạo Phỏng vấn giải pháp ','<h2>abcg<h2>',N'Hồ Chí Minh','9/1/2018','9/1/2018',GETDATE(),GETDATE(),N'/FilesUploaded/22_01_2018_09_49_087.jpg');
